import React from "react";
import ContentItem from "./ContentItem";
import ContentHeader from "./ContentHeader";
import ContentImg from "./ContentImg";

const ContetntItems = (props) => {
  const { repos } = props;

  if (!repos || repos.length === 0) return <p>server don't responce , sorry</p>;
  const val = Object.values(repos);
console.log(val);
  return (
    <div>
      {val.map((repo) => {
        Object.values(repo).map((data) => {
          if (data.type === "regular_carousel") {
            return (
              <div key={data.id}>
                <ContentHeader
                  partMovier={data.display_title}
                  fullviewurl="{data.fullviewurl}"
                />
                <ContentItem
                  urlMovie="{data.urlMovie}"
                  urlImage="{data.urlImage}"
                  rate="{data.rate}"
                  imdb="{data.imdb}"
                  name="{data.fullname}"
                />
                <ContentImg
                  poster="{data.poster}"
                  urlPoster="{data.urlPoster}"
                />
              </div>
            );
          }
        });
      })}
    </div>
  );
};

export default ContetntItems;
